import React, { Component } from 'react';

class ListarUsuarios extends Component{
    render() {
        return (
            <div>
                <h2>Lista de usuarios</h2>
                <table>
                    <thead>
                        <tr>
                            <th></th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td></td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}
export default ListarUsuarios;
